import React from "react";
import "./pitch-control.scss";

class PitchControl extends React.Component{
    constructor() {
        super();

    }




    render() {
        return (
            <Slider className="pitch" from={-8} to={8} onChange={this.props.onChange}></Slider>
        )
    }
}



export default PitchControl;
